import Vue from 'vue'
import App from './App.vue'
import ElementUI from 'element-ui'
import 'element-ui/lib/theme-chalk/index.css'
import router from './router'
import VueRouter from 'vue-router'
import CodeDiff from 'v-code-diff'
import VueGAPI from "vue-gapi"

const apiConfig = {
  apiKey: "AIzaSyDEJjlz8Jcois3vBb0JquloxlWR2PClDf8",
  clientId: "477015876356-b8mop6sg4hnq9spgqemfc87m958scdp0.apps.googleusercontent.com",
  discoveryDocs: ["https://sheets.googleapis.com/$discovery/rest?version=v4"],
  scope: "https://www.googleapis.com/auth/spreadsheets" // See, edit, create, and delete your spreadsheets in Google Drive
  // see all available scopes here: https://developers.google.com/identity/protocols/googlescopes'
};


Vue.use(CodeDiff);
Vue.use(ElementUI)
Vue.use(VueRouter)
Vue.use(VueGAPI, apiConfig);

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
  router,
  beforeCreate() {
    Vue.prototype.$bus = this //安装全局事件总线
  }
}).$mount('#app')
